    public static int lengthOfLongestSubstring(String string) {

        if (string == null || string.isEmpty()) {
            return 0;
        }

        char[] chars = string.toCharArray();
        ArrayList<Character> subString = new ArrayList<>();
        int counter = 1;

        for (int i = 0; i < chars.length; i++) {
            for (int j = i; j < chars.length; j++) {

                char currentChar = chars[j];
                if (subString.contains(currentChar)) {

                    int size = subString.size();
                    counter = Math.max(size, counter);
                    subString = new ArrayList<>();
                    break;
                } else {

                    subString.add(currentChar);
                }
            }
        }
        return counter;
    }
